import React, { Fragment } from "react";
import { Content } from "../Components/Content";
import {Card} from "react-bootstrap";
function LecturerDashboard(){
    return(
        <Fragment>
            <Content> 
                <div id="lecturerDashboard">
                    <Card className = "cardDashboard" style={{width: "20%", maxWidth: "200px"}}>
                    <Card.Title>
                        <i className={'fa-regular fa-bookmark'} id={'bookmarkIcon'}></i>
                    </Card.Title>
                    <p>Courses</p>
                    <h2>13</h2>
                    </Card>
                </div>
            </Content>
        </Fragment>
    );
}
export default LecturerDashboard;
